(218, 1, '2022-08-07 16:21:25', '2022-08-07 16:21:25', 'The championship series of the National Basketball Association (NBA) is called the <strong>NBA Finals</strong>. The series is played between the winners of the Western and Eastern Conference Finals, in a best of seven series of games.\r\n\r\nThe first NBA Finals was held in 1947, since then the NBA Finals has been played at the end of every NBA season. The winners of NBA Finals series are awarded the Larry O’Brien Championship Trophy.\r\n\r\nThe winning team of the NBA Finals since 1985 is determined through a 2-3-2 format—the first and last two games of the series being played at the arena of the team who earned home court advantage by having the better record during the regular season.', 'Basketball', '', 'publish', 'open', 'closed', '', 'basketball', '', '', '2022-08-07 16:21:25', '2022-08-07 16:21:25', '', 0, 'http://localhost/adidas/?post_type=events&#038;p=218', 0, 'events', '', 0),
